B.Xx=new A.L(B.Yi,["Cross-Platform Developer","I build functional, efficient, and user-focused systems, and I\u2019m passionate about what I do.","Optional","Mijael Viricochea","I am a cross-platform developer with expertise in Dart, Python, SQL, and tools like Flutter, Django, Docker, and PostgreSQL. Specializing in business systems development, user-centered design, and scalable architectures, I focus on creating efficient, impactful software solutions. With a passion for problem-solving and optimization, I am continuously learning and currently deepening my knowledge in advanced Flutter, DevOps, and system scalability to stay at the forefront of technology.\n\nCurrently, I am focused on developing production-ready systems, constantly refining my skills to deliver robust and impactful software. My work prioritizes both technical precision and real-world usability, ensuring that each project meets the needs of its users.\n\nIn the past, I\u2019ve had the chance to explore various aspects of software development, tackling challenges across different domains. From building full-fledged business systems to refining tools for better operational management, each project has been an exciting opportunity to learn and grow.\n\nWhen I\u2019m not coding, you\u2019ll find me exploring new technologies, diving into creative hobbies, or strategizing my way through epic battles in search of rare materia.","About","Projects","E-Tech","A comprehensive system designed to streamline inventory management and point-of-sale (POS) operations. Topics covered include inventory tracking, sales processing, reporting features, multi-user access, and integration with external services. Technologies used include Django, PostgreSQL, React, and Docker.","Clinicaut: Dental Clinic Management System","A specialized system designed to optimize operations in dental clinics. Features include patient management, appointment scheduling, billing, reporting, and the ability to store detailed medical histories."],t.yf)
